const Total = ({ good, neutral, bad, total, positiveFeedback }) => {
    console.log({ good })
    return (

        <>
            <ul>
                <li>Good: {good}</li>
                <li>Neutral: {neutral}</li>
                <li>Bad:{bad}</li>
                <li>Total:{total}</li>
                <li>Positive feedback: {positiveFeedback}%</li>
            </ul>
        </>
    )
}

export default Total;
